import VoteResultList from "./VoteResultList";
const VoteResultTable = (props) => {
  return (
    <div className="result-item">
      <span>{props.category}</span>
      <table>
        <thead>
          <tr>
            <th>S.N</th>
            <th>Name</th>
            <th>Votes</th>
          </tr>
        </thead>
        <tbody>
            <VoteResultList/>
        </tbody>
      </table>
    </div>
  );
};

export default VoteResultTable;
